import React, { useState } from "react";
import {planeteers} from "./db"

function Planeteer({planeteers}) {
    const {name, bio, twitter, pictureUrl, fromUSA} = planeteers;

  return (
    <li className="cardsitem">
      <div className="card">
        <img
          src={ planeteers.pictureUrl}
          alt={"RENDER PERSON NAME"}
          className="cardimage"
        />
        <div className="cardcontent">
          <div className="cardtitle">{planeteers.name}</div>
          <p className="cardtext">{bio}</p>
          <div className="carddetail">
            <p>{planeteers.twitter}</p>
            <p>
              {fromUSA ? "USA-based" : "Working overseas"}
            </p>
          </div>
        </div>
      </div>
    </li>
  );
}

export default Planeteer;
